import React from "react";
import Swal from "sweetalert2/themes/dark";

const onBark = () => {
    Swal.fire("Woof! Woof!");
}

const DogDetails = (props: { name: React.ReactNode; imagePath: string; }) => {
    return (
        <div className="DogDetails">
            <button id="buttonAlert" onClick={ onBark }>Bark</button>
            <h1>{props.name}</h1>
            <img src={props.imagePath} width="400" height="200" alt=""/>
        </div>
    );
}

export default DogDetails;
